odbc_execute just returns a boolean to indicate success or failure. What you need to return is $pstmt:

function reader($ser)
{
    $pstmt = odbc_prepare($this->conn, 'SELECT TOP 1 "name"
        FROM '.$this->table.' WHERE 
        "surname" LIKE ? ');        
    if(!odbc_execute($pstmt, array("$ser")))
        die('odbc_execute failed');
    return $pstmt;
}

