You can force Android to hide the virtual keyboard using the InputMethodManager, calling hideSoftInputFromWindow, passing in the token of the window containing your focused view.

// Check if no view has focus:
View view = this.getCurrentFocus();
if (view != null) {  
    InputMethodManager imm = (InputMethodManager)getSystemService(Context.INPUT_METHOD_SERVICE);
    imm.hideSoftInputFromWindow(view.getWindowToken(), 0);
}
This will force the keyboard to be hidden in all situations. In some cases, you will want to pass in InputMethodManager.HIDE_IMPLICIT_ONLY as the second parameter to ensure you only hide the keyboard when the user didn't explicitly force it to appear (by holding down the menu).

Note: If you want to do this in Kotlin, use: context?.getSystemService(Context.INPUT_METHOD_SERVICE) as InputMethodManager

Kotlin Syntax

// Only runs if there is a view that is currently focused
this.currentFocus?.let { view ->
    val imm = getSystemService(Context.INPUT_METHOD_SERVICE) as? InputMethodManager
    imm?.hideSoftInputFromWindow(view.windowToken, 0)
}

If you already know the color of the logo, you can use colord to calculate the contrast between the logo and any given color. You can then loop the comparison, adjusting the background color, until you reach a usable value.

Keep in mind you'll need to use the a11y plugin for access to .contrast()

Something like:

let contrast = 0;
let backgroundColor = logoColor;
const logoBrightness = colord(logoColor).brightness()
while (contrast < 4.5) {
  contrast = colord(logoColor).contrast(backgroundColor);
  if (logoBrightness <= 0.5) { 
      backgroundColor = colord(backgroundColor).lighten(0.05);
  } else backgroundColor = colord(backgroundColor).darken(0.05);
}
You can replace 4.5 with any amount of contrast you desire. How you apply that value to the element's backgroundColor will depend on your frameworks and preferences.

Even in Java, the distinction doesn't really exist. Sometimes it is convenient to think of objects being passed by reference, in that I can pass an object to a method, the method can mutate the object, and I can see that mutation in the parent method. But really we've just passed the method a pointer to our object, by value, and it dereferences that pointer to modify it.

This may seem like splitting hairs: isn't an implicit pointer the same as a reference? No, because the method we call can't reassign the pointer for us, the same way that C# could with a ref parameter. For example, if I have an immutable type:

final class IntPair {
  final int x;
  final int y;
  IntPair(int x, int y) { this.x = x; this.y = y; }
}
and I pass such an IntPair to a method, I know its x and y fields will be unchanged. The type provides no way to mutate itself, and the language provides no way to replace the object with another.

