            newWebView.settings.javaScriptCanOpenWindowsAutomatically = true

            newWebView.webViewClient = object : WebViewClient() {
                override fun onPageStarted(view: WebView?, url: String?, favicon: Bitmap?) {
                    // Starts loading
                    super.onPageStarted(view, url, favicon)
                }

                override fun shouldOverrideUrlLoading(view: WebView?, request: WebResourceRequest?): Boolean {
                    val newUrl = request?.url?.toString()
                    if (newUrl != null) {
                        view?.loadUrl(newUrl)
                    }
                    return true
                }

                override fun onReceivedSslError(view: WebView?, handler: SslErrorHandler?, error: SslError?) {
                    // Never called
                    handler?.proceed()
                }
            }

            transport.webView = newWebView
            transport.handler?.sendEmptyMessage(0)
            return true
        }

        return super.onCreateWindow(view, isDialog, isUserGesture, resultMsg)
    }
}
In this modified code, we create a new WebView inside the onCreateWindow method of the WebViewClient. We then set the appropriate settings and create a new WebViewClient for the new WebView. In the shouldOverrideUrlLoading method of the new WebViewClient, we load the URL for the authentication page in the new WebView. Finally, we set the WebViewTransport to use the new WebView and send an empty message to the WebView to start loading the page.

Note that we are returning true in the onCreateWindow method to indicate that we are handling the new window ourselves. If you want the default behavior, you can return false instead.

One possibility for the unregister failure is that the graphics resource is still in use by the GPU when the unregister call is made. This could happen if the GPU is still drawing the previous frame while the resize operation is happening. One way to avoid this is to synchronize the CPU and GPU using a fence before unregistering the resource:

// synchronize CPU and GPU using a fence
glFlush();
glFinish();
cudaGraphicsMapResources(1, &m_cuda_pbo_resource, 0);
cudaGraphicsUnmapResources(1, &m_cuda_pbo_resource, 0);

// unregister resources
CUDA_SAFE_CALL(cudaGraphicsUnregisterResource(m_cuda_pbo_resource));
CUDA_SAFE_CALL(cudaGraphicsUnregisterResource(m_cuda_pbo_depth_resource));
glDeleteBuffersARB(1, &m_pbo);
glDeleteBuffersARB(1, &m_pbo_depth);

This will ensure that the GPU has finished drawing the previous frame and is not using the resource before it is unregistered.

Another possibility is that there is a memory leak or corruption in the code that is causing the unregister call to fail. You can try running a memory profiler or a debugger to check for any issues in the code that could be causing the problem. Additionally, you can try simplifying the resize code to isolate the issue and make it easier to debug.

