The problem with defining a new unit for the Euro symbol is that it is not a valid LaTeX command by default, so it cannot be used in a command like \DeclareSIUnit. One workaround is to define the symbol as a text command using \newcommand, and then use that in the \DeclareSIUnit command. Here's an updated MWE:

\documentclass{article}
\usepackage{eurosym,textcomp,siunitx}

% Define Euro symbol as text command
\newcommand{\myeuro}{\texteuro}

% Use Euro symbol in a new SI unit
\DeclareSIUnit{\EUR}{\myeuro}

\begin{document}
Unicode symbol (‚Ç¨), euro (\euro) and texteuro (\texteuro)
all work fine in text, but for some reason I can't
